import React from "react";
function Broker() {
  return ( 
      <div className="container">
        <div className="row p-5">
          <div className="col-8">
            <h3>Brokerage calculator</h3>
          </div>
          <div className="col-4">
            <h3>List of charges</h3>
          </div>
        </div>
      </div>
   );
}

export default Broker;
